import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup'
import axios from 'axios';

function App() {



  return (
    <div className="App">
      <header className="App-header">
        <ButtonGroup>
          <Button
            size="large"
            variant="contained"
            color="primary"
            onClick={onButton}>
              ON
          </Button>
          <Button
            size="large"
            variant="contained"
            color="secondary"
            onClick={offButton}>
            OFF
          </Button>
        </ButtonGroup>


        {/* Not needed */}
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
